import React, { Component } from "react";
import Card from "./CardUI";
import img1 from "../assets/Breathe.png";
import img2 from "../assets/Jumping.png";
import img3 from "../assets/Happy.png";

class Cards extends Component {
  render() {
    return (
      <div className="container-fluid d-flex justify-content-center">
        <div className="row">
          <div className="col-md-4">
            <Card
              imgsrc={img1}
              title="Exciting"
              text="Explore my money making app"
            />
          </div>
          <div className="col-md-4">
            <Card imgsrc={img2} title="Jumping" text="This is card 2" />
          </div>
          <div className="col-md-4">
            <Card imgsrc={img3} title="Happy" text="This is card 3" />
          </div>
        </div>
      </div>
    );
  }
}

export default Cards;
